Collector items that belong to a component are supposed to be clones of the corresponding collector items in the CollectorItem repository. But, while the collector items in the CollectorItem repository are being updated by the collector, the ones in the Component repository remain out of sync.

Due to this, when the inactive items are being disabled by the DashBoard service in DashBoardServiceImpl.java:174, items in the CollectorItem repository are being overwritten by the out of sync items from the Component repository. As a result of this, additional data which was stored in the CollectorItem repository are lost when being disabled. For example, lastUpdate and lastUpdateCommit are lost in the case of SCM collector items when they are disabled.

@satishc1 @jimzucker @johnkangcurd @tabladrum

@tabladrum Product dashboard displays NaN for security issues, if 'blocker' issues contain empty string, though 'critical' or 'major' issues types have non Zero values. The graph for security issues also displays nothing in such cases, if 'blocker' issues have a zero value.

Possible cause might be usage of parseInt in /Hygieia/UI/src/components/widgets/product/js/security-analysis-data.js, which returns NaN for empty string.

Line 68 : blocker: parseInt(getCaMetric(metrics, 'blocker'))

