There is a typo "captialone" instead of "capitalone" in ProjectDataClientImplTest.java:1 which is causing the build to fail:
`package com.captialone.dashboard.client.project;`

@mrpudn

Documenting this so it doesn't get forgotten about / lost...

This is due to the EventComponentEventListener being triggered on any environment_component that is saved. The XLD collector is resaving environment_components even if they have not changed. Not sure if the UDeploy collector is doing this too. As a result commits are being added to every environment in a pipeline which causes hygieia to interpret them as always being promoted to the last environment.

Code:

```
                if (!compList.isEmpty()) {
                    List<EnvironmentComponent> existingComponents = envComponentRepository
                            .findByCollectorItemIdAndEnvironmentID(application.getId(), environmentId);
                    envComponentRepository.delete(existingComponents);
                    envComponentRepository.save(compList);
                }
```

Duplicate collector_items can be created which results in strange behavior. Below is an example for SCM collector_items but I suspect this may happen in other places.

Steps to reproduce
1. Create a dashboard and set it up the "Code Repo" widget to use a repository that has not been used.
2. Wait for a scm collector to run
3. Refresh the page. Open the widget and save it.

There will now be 2 collector_items that correspond to the same repo + branch + scm type combination.

This is because once the scm collector runs the collector might have additional options tacked on. For example, the BitbucketCollector adds the "lastUpdate" and "lastCommit" options. Hence findByCollectorAndOptions does not find the existing collector_item since the incoming item.getOptions() do not contain this information.
CollectorServiceImpl.java:

```
    public CollectorItem createCollectorItem(CollectorItem item) {
        CollectorItem existing = collectorItemRepository.findByCollectorAndOptions(
                item.getCollectorId(), item.getOptions());
        if (existing != null) {
            item.setId(existing.getId());
        }
        return collectorItemRepository.save(item);
    }
```

I think findByCollectorAndOptions needs to be changed to allow items to show up if they have additional properties that do not exist in the incoming map. Will have to check mongo documentation if this can be done.

